  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.scss']
})
export class AppComponent {
  title = 'starter-project';
}
<app-header></app-header>
<div class="content">
  <app-ticket-form></app-ticket-form>
  <app-ticket-list></app-ticket-list>
</div>
